INSERT INTO `report` VALUES ('5', 'Relatorio Excel SIF - Semana Atual - Frigorífico de Aves ', 'Relatorio Excel das Temperaturas do Frigorífico de Aves ', 'template_aves.xls', '', '', '', '', '', '', '', '', '', '', 'SELECT \r\nStr(TimeValue(temp.Date)) AS Hora, \r\nMax(IIf(Weekday(temp.Date)=1,temp.PV)) AS Domingo, \r\nMax(IIf(Weekday(temp.Date)=2,temp.PV)) AS Segunda, \r\nMax(IIf(Weekday(temp.Date)=3,temp.PV)) AS Terca, \r\nMax(IIf(Weekday(temp.Date)=4,temp.PV)) AS Quarta, \r\nMax(IIf(Weekday(temp.Date)=5,temp.PV)) AS Quinta, \r\nMax(IIf(Weekday(temp.Date)=6,temp.PV)) AS Sexta,\r\nMax(IIf(Weekday(temp.Date)=7,temp.PV)) AS Sabado\r\nFROM Aves temp, Tags_Aves tag\r\nWHERE DatePart(\'ww\', temp.Date) = DatePart(\'ww\',Now())\r\nAND temp.Tag = tag.id \r\nAND tag.descricao = $P{tag_aves}\r\nGROUP BY TimeValue(temp.Date)', '3', null, '5');
INSERT INTO `report` VALUES ('28', 'Relatorio Tabular SIF - Semana Atual - Frigorifico de Aves', 'Relatorio no Formato de Tabela das Temperaturas do Frigorífico de Aves ', 'template_tabular.ftl', '', '', '', '', '', '', '', '', '', '', 'SELECT \r\nStr(TimeValue(temp.Date)) AS Hora, \r\nMax(IIf(Weekday(temp.Date)=1,temp.PV)) AS Domingo, \r\nMax(IIf(Weekday(temp.Date)=2,temp.PV)) AS Segunda, \r\nMax(IIf(Weekday(temp.Date)=3,temp.PV)) AS Terca, \r\nMax(IIf(Weekday(temp.Date)=4,temp.PV)) AS Quarta, \r\nMax(IIf(Weekday(temp.Date)=5,temp.PV)) AS Quinta, \r\nMax(IIf(Weekday(temp.Date)=6,temp.PV)) AS Sexta,\r\nMax(IIf(Weekday(temp.Date)=7,temp.PV)) AS Sabado\r\nFROM Aves temp, Tags_Aves tag\r\nWHERE DatePart(\'ww\', temp.Date) = DatePart(\'ww\',Now())\r\nAND temp.Tag = tag.id \r\nAND tag.descricao = $P{tag_aves}\r\nGROUP BY TimeValue(temp.Date)', '3', null, '28');
