INSERT INTO `report_chart` VALUES ('4', 'grafico_aves_data', 'Tempo x Valor', 'SELECT tag.descricao, avg(temp.PV), temp.Date\r\nFROM Tags_Aves tag, Aves temp\r\nWHERE tag.id = temp.Tag AND \r\ntag.descricao = $P{tag_aves} AND temp.Date BETWEEN \r\n$P{data_inicial} AND $P{data_final}\r\nGROUP BY tag.descricao, temp.Date\r\n\r\n\r\n', '3', '1024', '768', 'Horario Gravacao', 'Temperatura °C', '', '', '', '2', '3', null, null);
INSERT INTO `report_chart` VALUES ('17', 'comparacao_media_semanal', 'Valor x Tempo', '(SELECT AVG(ANTERIOR.PV) AS media, \"Semana Anterior\", DAYNAME(ANTERIOR.datetime) AS dia_semana \r\nFROM tags INNER JOIN temperaturas ANTERIOR ON tags.id = ANTERIOR.tag_id \r\nAND tags.descricao = $P{tag} \r\nAND WEEK(ANTERIOR.datetime) = WEEK(NOW() - INTERVAL 7 DAY ) \r\nGROUP BY DAY(ANTERIOR.datetime)\r\nORDER BY ANTERIOR.datetime )\r\n\r\nUNION\r\n\r\n(SELECT AVG(ATUAL.PV) AS media, \"Semana Atual\", DAYNAME(ATUAL.datetime) AS dia_semana \r\nFROM tags INNER JOIN temperaturas ATUAL ON tags.id = ATUAL.tag_id \r\nAND tags.descricao = $P{tag} \r\nAND WEEK(ATUAL.datetime) = WEEK( NOW() ) \r\nGROUP BY DAY(ATUAL.datetime)\r\nORDER BY ATUAL.datetime )', '5', '1024', '768', 'Dia da Semana', 'Temperatura °C', '', '', '', '2', '3', null, null);
INSERT INTO `report_chart` VALUES ('22', 'comparacao_media_diaria', 'Valor x Tempo', '(SELECT AVG(ANTERIOR.PV) AS media, \"Mes Anterior\", DAY(ANTERIOR.datetime) AS dia_mes \r\nFROM tags INNER JOIN temperaturas ANTERIOR ON tags.id = ANTERIOR.tag_id \r\nAND tags.descricao = $P{tag} \r\nAND MONTH(ANTERIOR.datetime) = MONTH(NOW() - INTERVAL 1 MONTH ) \r\nGROUP BY DAY(ANTERIOR.datetime)\r\nORDER BY ANTERIOR.datetime )\r\n\r\nUNION\r\n\r\n(SELECT AVG(ATUAL.PV) AS media, \"Mes Atual\", DAY(ATUAL.datetime) AS dia_mes \r\nFROM tags INNER JOIN temperaturas ATUAL ON tags.id = ATUAL.tag_id \r\nAND tags.descricao = $P{tag} \r\nAND MONTH(ATUAL.datetime) = MONTH( NOW() ) \r\nGROUP BY DAY(ATUAL.datetime)\r\nORDER BY ATUAL.datetime )', '5', '1024', '768', 'Dia ', 'Temperatura °C', '', '', '', '2', '3', null, null);
INSERT INTO `report_chart` VALUES ('23', 'comparacao_media_anual', 'Valor x Tempo', '(SELECT AVG(ANTERIOR.PV) AS media, \"Ano Anterior\", MONTHNAME(ANTERIOR.datetime) AS mes \r\nFROM tags INNER JOIN temperaturas ANTERIOR ON tags.id = ANTERIOR.tag_id \r\nAND tags.descricao = $P{tag} \r\nAND YEAR(ANTERIOR.datetime) = YEAR(NOW() - INTERVAL 1 YEAR ) \r\nGROUP BY MONTH(ANTERIOR.datetime)\r\nORDER BY ANTERIOR.datetime )\r\n\r\nUNION\r\n\r\n(SELECT AVG(ATUAL.PV) AS media, \"Ano Atual\", MONTHNAME(ATUAL.datetime) AS mes \r\nFROM tags INNER JOIN temperaturas ATUAL ON tags.id = ATUAL.tag_id \r\nAND tags.descricao = $P{tag} \r\nAND YEAR(ATUAL.datetime) = YEAR( NOW() ) \r\nGROUP BY MONTH(ATUAL.datetime)\r\nORDER BY ATUAL.datetime )', '5', '1024', '768', 'Mes', 'Temperatura °C', '', '', '', '2', '3', null, null);
INSERT INTO `report_chart` VALUES ('24', 'grafico_aves_semana_atual', 'Tempo x Valor', 'SELECT tag.descricao, avg(temp.PV), temp.Date\r\nFROM Tags_Aves tag, Aves temp\r\nWHERE tag.id = temp.Tag AND \r\ntag.descricao = $P{tag_aves} AND \r\nDatePart(\'ww\', temp.Date) = DatePart(\'ww\',Now())\r\nGROUP BY tag.descricao, temp.Date\r\n\r\n\r\n', '3', '1200', '500', 'Horario Gravacao', 'Temperatura °C', '', '', '', '2', '3', null, null);
